DROP TABLE IF EXISTS `order_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order_record` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `order_number` varchar(100) DEFAULT NULL COMMENT '订单号',
  `order_amount` double DEFAULT '0' COMMENT '订单金额',
  `receipt_name` varchar(45) DEFAULT NULL COMMENT '收货姓名',
  `sex` char(1) DEFAULT '0',
  `receiving_call` varchar(45) DEFAULT NULL COMMENT '收货电话',
  `shipping_address` varchar(100) DEFAULT NULL COMMENT '收货地址',
  `longitude` decimal(10,7) DEFAULT NULL COMMENT '经度',
  `latitude` decimal(10,7) DEFAULT NULL COMMENT '收货人纬度',
  `order_body` varchar(200) DEFAULT NULL,
  `payment_method` int(11) DEFAULT NULL COMMENT '支付方式  0微信  1支付宝',
  `order_state` char(10) DEFAULT '1' COMMENT '外卖订单状态: 1用户下单成功，2商家接单成功(接单成功后，配送状态默认为未配送)，3商户派送中(当商户点击了配送，状态改为3)，\n			4用户收货成功(用户收货则订单完成)  5用户取消并退款成功  \n\n\n团购订单状态:10未使用   11使用(用户使用则订单完成)　12取消订单  　\n ',
  `order_time` varchar(45) DEFAULT NULL COMMENT '订单下单时间',
  `mark` char(1) DEFAULT '0' COMMENT '0是外卖    1是团购',
  `account_token` varchar(45) DEFAULT NULL COMMENT '用户token',
  `shop_id` bigint(20) unsigned DEFAULT NULL COMMENT '店铺id',
  `gmt_create` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '生成时间',
  `gmt_modified` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '收货人经度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8;
